import classes from "./availablemeals.module.css";
import Card from "../ui/card";
import MealItem from "./mealitem/mealitem";

const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Idly",
    description: "Steamed rice cakes.",
    price: 25,
  },
  {
    id: "m2",
    name: "Dosa",
    description: "Thin South Indian crepe!",
    price: 70,
  },
  {
    id: "m3",
    name: "Poori",
    description: "Deep-fried Indian bread....",
    price: 70,
  },
  {
    id: "m4",
    name: "Pongal",
    description: "Savory rice-lentil dish....",
    price: 70,
  },
  {
    id: "m5",
    name: "Vada",
    description: "Crispy South Indian Lentil Fritter..",
    price: 25,
  },
  {
    id: "m6",
    name: "Masal Dosa",
    description: "South Indian Spiced Rice Crepe!",
    price: 100,
  },
  {
    id: "m7",
    name: "Onion Dosa",
    description: "Flavorful Onion-stuffed Rice Crepe..",
    price: 90,
  },
  {
    id: "m8",
    name: "Ghee Dosa",
    description: "Buttery and Crispy Rice Crepe....",
    price: 130,
  },
  {
    id: "m9",
    name: "Rava Dosa",
    description: "Crispy Semolina Pancake Delight!",
    price: 120,
  },
  {
    id: "m10",
    name: "Kichadi",
    description: "Hearty and Flavorful Rice Dish....",
    price: 60,
  },
];

const AvailableMeals = () => {
  const mealslist = DUMMY_MEALS.map((meal) => (
    <MealItem
      id={meal.id}
      key={meal.id}
      name={meal.name}
      description={meal.description}
      price={meal.price}
    />
  ));
  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealslist}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
